import React from 'react';

import "./MainLayoutCss.css";

import {MainLayoutController} from './MainLayoutController';
import 
    {
        DefaultColor,

        MainContainer,
        MenuContainer,
        MenuSmall,
            MenuInner,MenuFloat,
        MenuBig,
        MenuLine,
        Alink,
        MainBody,DivFloat,
        MainFooter,
        MainFooterInner,
        GetInTouchCaption,
        WebsiteLink
    } 
from './MainLayoutElement';

//import logo from '../../logo.svg';
import logo from '../../components/logo.svg';
import {Icon} from '../../components/icons';

// =============================== VARIABLE ==================================



// =============================== END VARIABLE ==============================

export function MainLayout({
component: Component, 
layout: Layout, 
...properties
}) {
return (
    <Route {...properties} render={(props) =>
    <Layout  {...properties} {...props} components={<Component />} />
    } />
);
}
